import {
	VerticalTimeline,
	VerticalTimelineElement,
} from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";

const Timeline = () => {
	return (
		<VerticalTimeline>
			<VerticalTimelineElement
				className='vertical-timeline-element--work'
				contentStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
				contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
				// date='2011 - present'
				iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
				// icon={<WorkIcon />}
			>
				<h3 className='vertical-timeline-element-title'>Prelaunch</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>Miami, FL</h4> */}
				<p>
					⭕️ Daily Challenges to win a Free-Diadragon! <br />
					⭕️ 5-question-Fridays on Kahoot! Winner gets a Diadragon! <br />
					⭕️ Weekly townhalls <br />
					⭕️ Pre-launch merch! (whaaaat?! Learn more by inviting 10 friends!)
				</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--work'
				// date='2010 - 2011'
				iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
				// icon={<WorkIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Pre-Sale: October 27th
				</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>
					San Francisco, CA
				</h4> */}
				<p>
					⭕️ If you invite 10 friends and answer a question you will have
					access to our pre-launch! This is the best way to get a diadragon (or
					two) with low gas fees!
				</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--work'
				// date='2008 - 2010'
				iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
				// icon={<WorkIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Mint Day: October 30th
				</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>Los Angeles, CA</h4> */}
				{/* <p>User Experience, Visual Design</p> */}
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--work'
				// date='2006 - 2008'
				iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
				// icon={<WorkIcon />}
			>
				<h3 className='vertical-timeline-element-title'>Reveal day: November 1st! </h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>
					San Francisco, CA
				</h4> */}
				<p>
					⭕️ Will you get a rare diadragon???
					<br />
					⭕️ Got any games? Earn Your Wings Challenge Announcement
				</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--education'
				date='April 2013'
				iconStyle={{ background: "rgb(233, 30, 99)", color: "#fff" }}
				// icon={<SchoolIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Content Marketing for Web, Mobile and Social Media
				</h3>
				<h4 className='vertical-timeline-element-subtitle'>Online Course</h4>
				<p>Strategy, Social Media</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--education'
				date='November 2012'
				iconStyle={{ background: "rgb(233, 30, 99)", color: "#fff" }}
				// icon={<SchoolIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Agile Development Scrum Master
				</h3>
				<h4 className='vertical-timeline-element-subtitle'>Certification</h4>
				<p>Creative Direction, User Experience, Visual Design</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--education'
				date='2002 - 2006'
				iconStyle={{ background: "rgb(233, 30, 99)", color: "#fff" }}
				// icon={<SchoolIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Bachelor of Science in Interactive Digital Media Visual Imaging
				</h3>
				<h4 className='vertical-timeline-element-subtitle'>Bachelor Degree</h4>
				<p>Creative Direction, Visual Design</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				iconStyle={{ background: "rgb(16, 204, 82)", color: "#fff" }}
				// icon={<StarIcon />}
			/>
		</VerticalTimeline>
	);
};
export default Timeline;
